import logo from './logo.svg';
import './App.css';

function App() {
  const name = "Tom";
  const naver = {
    name : "네이버",
    URL : "https://naver.com",
  }
  return (
    <div className="App">
      <h1 
      style={{
        color: "#f0f",
        backgroundColor: "green",
      }}
      >Hello, {name}!<p>{2 + 3}</p>
      </h1>
      <a href={naver.URL}>{naver.name}</a>
    </div>
  );
}

export default App;
